import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useAuth } from './AuthContext';

function Dashboard() {
    const { auth } = useAuth();
    const [quote, setQuote] = useState('');
    const [joke, setJoke] = useState('');
    const [isEditing, setIsEditing] = useState(false);
    const [profile, setProfile] = useState({
        name: auth?.user?.name || '',
        email: auth?.user?.email || '',
        signupDate: new Date().toLocaleDateString()
    });

    useEffect(() => {
        fetchQuote();
        fetchJoke();
    }, []);

    const fetchQuote = async () => {
        try {
            const response = await axios.get('https://api.quotable.io/random');
            if (response.data?.content) {
                setQuote(response.data.content);
            }
        } catch (error) {
            setQuote('Wisdom comes from within.');
        }
    };

    const fetchJoke = async () => {
        try {
            const response = await axios.get('https://official-joke-api.appspot.com/random_joke');
            if (response.data) {
                setJoke(`${response.data.setup} ${response.data.punchline}`);
            }
        } catch (error) {
            setJoke('Why did the developer go broke? Because he used up all his cache!');
        }
    };

    const handleProfileUpdate = async (e) => {
        e.preventDefault();
        try {
            // Update profile logic here
            setIsEditing(false);
        } catch (error) {
            console.error('Profile update failed:', error);
        }
    };

    return (
        <div className="min-h-screen bg-gray-100 py-6 flex flex-col justify-center sm:py-12">
            <div className="relative py-3 sm:max-w-xl md:max-w-2xl lg:max-w-4xl mx-auto">
                <div className="relative px-4 py-10 bg-white shadow-lg sm:rounded-3xl sm:p-20">
                    <div className="max-w-md mx-auto">
                        <div className="divide-y divide-gray-200">
                            {/* Welcome Section */}
                            <div className="py-8 text-base leading-6 space-y-4 text-gray-700 sm:text-lg sm:leading-7">
                                <h1 className="text-3xl font-bold text-blue-600 mb-8">
                                    Welcome, {profile.name}!
                                </h1>
                                
                                {/* Quote Section */}
                                <div className="bg-blue-50 p-4 rounded-lg mb-8">
                                    <p className="italic text-gray-600">"{quote}"</p>
                                    <button 
                                        onClick={fetchQuote}
                                        className="mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
                                    >
                                        New Quote
                                    </button>
                                </div>

                                {/* Profile Section */}
                                <div className="bg-white rounded-lg shadow p-6 mb-8">
                                    <h2 className="text-2xl font-semibold mb-4">Profile Information</h2>
                                    {isEditing ? (
                                        <form onSubmit={handleProfileUpdate}>
                                            <div className="space-y-4">
                                                <input
                                                    type="text"
                                                    value={profile.name}
                                                    onChange={(e) => setProfile({...profile, name: e.target.value})}
                                                    className="w-full p-2 border rounded"
                                                    placeholder="Name"
                                                />
                                                <input
                                                    type="email"
                                                    value={profile.email}
                                                    onChange={(e) => setProfile({...profile, email: e.target.value})}
                                                    className="w-full p-2 border rounded"
                                                    placeholder="Email"
                                                />
                                                <button
                                                    type="submit"
                                                    className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
                                                >
                                                    Save Changes
                                                </button>
                                            </div>
                                        </form>
                                    ) : (
                                        <div className="space-y-2">
                                            <p><span className="font-semibold">Name:</span> {profile.name}</p>
                                            <p><span className="font-semibold">Email:</span> {profile.email}</p>
                                            <p><span className="font-semibold">Member Since:</span> {profile.signupDate}</p>
                                            <button
                                                onClick={() => setIsEditing(true)}
                                                className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600 mt-4"
                                            >
                                                Edit Profile
                                            </button>
                                        </div>
                                    )}
                                </div>

                                {/* Joke Section */}
                                <div className="bg-yellow-50 p-4 rounded-lg">
                                    <h3 className="font-semibold mb-2">Random Joke</h3>
                                    <p className="text-gray-700">{joke}</p>
                                    <button
                                        onClick={fetchJoke}
                                        className="mt-4 bg-yellow-500 text-white px-4 py-2 rounded hover:bg-yellow-600"
                                    >
                                        Get New Joke
                                    </button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Dashboard;
